import React, { useEffect } from "react"
import { Flex, Text, Box, Image } from "rebass"
import { Input } from "@rebass/forms"

export default props => {
	return (
		<Flex
			alignItems="center"
			height="80px"
			pl="24px"
			sx={{
				cursor: "pointer",
				"&:hover": {
					background: "rgba(255, 255, 255, 0.5)"
				}
			}}
		>
			<Input
				width="3rem"
				height="0.38rem"
				id="username"
				name="username"
				type="text"
				placeholder="XXX"
			/>
			<Text fontSize="0.14rem">{props.name}</Text>
		</Flex>
	)
}
